import {
    Button,
    Layout,
    Page
} from '@shopify/polaris';

class Login extends React.Component {
    render(){
        return (
            <Page>
                <Layout>
                    <Button style={{ backgroundColor: 'white', color: 'red' }}>Signin With Instagram</Button>
                </Layout>
            </Page>
        );
    }
}

export default Login;
